;; Operator: PutObjectInReceptacle
(:action PutObjectInReceptacle
        :parameters (?a - agent ?l - location ?ot - otype ?o - object ?r - receptacle)
        :precondition (and
            (atLocation ?a ?l)
            (receptacleAtLocation ?r ?l)
            (objectType ?o ?ot)
            (holds ?a ?o)
            (not (holdsAnyReceptacleObject ?a))
        )
        :effect (and
            (inReceptacle ?o ?r)
            (not (holds ?a ?o))
            (not (holdsAny ?a))
            (objectAtLocation ?o ?l)
        )
    )

<END>

;; Operator: PutReceptacleObjectInReceptacle
(:action PutReceptacleObjectInReceptacle
        :parameters (?a - agent ?l - location ?ot - otype ?outerO - object ?r - receptacle)
        :precondition (and
            (atLocation ?a ?l)
            (receptacleAtLocation ?r ?l)
            (objectType ?outerO ?ot)
            (holds ?a ?outerO)
            (holdsAnyReceptacleObject ?a)
            (isReceptacleObject ?outerO)
        )
        :effect (and
            (forall
                (?obj - object)
                (when
                    (holds ?a ?obj)
                    (and
                        (not (holds ?a ?obj))
                        (objectAtLocation ?obj ?l)
                        (inReceptacle ?obj ?r)
                    )
                )
            )
            (not (holdsAny ?a))
            (not (holdsAnyReceptacleObject ?a))
        )
    )

<END>

